"use strict";(self.webpackChunkyana_github_io=self.webpackChunkyana_github_io||[]).push([[1139],{23067:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"typescript","metadata":{"permalink":"/frontend/typescript","source":"@site/frontend/2023-09-14-Typescript/index.md","title":"TypeScript","description":"\u8bed\u8a00\u7c7b\u578b","date":"2023-09-14T00:00:00.000Z","tags":[{"inline":true,"label":"typescript","permalink":"/frontend/tags/typescript"},{"inline":true,"label":"\u5b9e\u6218","permalink":"/frontend/tags/\u5b9e\u6218"}],"readingTime":2.74,"hasTruncateMarker":false,"authors":[{"name":"Yana Ching","title":"Front End Engineer","url":"https://yamadev.github.io/","imageURL":"https://github.com/yanadev.png","key":"yana","page":null}],"frontMatter":{"slug":"typescript","title":"TypeScript","authors":"yana","tags":["typescript","\u5b9e\u6218"]},"unlisted":false,"nextItem":{"title":"AJAX \u52a8\u6001\u52a0\u8f7d","permalink":"/frontend/ajax-dynamic"}},"content":"## \u8bed\u8a00\u7c7b\u578b\\n\\n### \u9759\u6001\u7c7b\u578b\uff1a\u7f16\u8bd1\u9636\u6bb5\u786e\u5b9a\u53d8\u91cf\u7c7b\u578b \uff08C++\uff09\\n\\n1. \u7c7b\u578b\u68c0\u67e5\u6781\u5ea6\u4e25\u683c\\n2. \u7acb\u5373\u53d1\u73b0\u9519\u8bef\\n3. \u8fd0\u884c\u65f6\u6027\u80fd\u597d\\n4. \u81ea\u6587\u6863\u5316\\n\\n### \u52a8\u6001\u7c7b\u578b\uff1a\u6267\u884c\u9636\u6bb5\u786e\u5b9a\u53d8\u91cf\u7c7b\u578b\uff08JS\uff09\\n\\n1. \u7c7b\u578b\u68c0\u67e5\u5bbd\u677e\\n2. bug \u53ef\u80fd\u9690\u85cf\u6570\u6708\u751a\u81f3\u6570\u5e74\\n3. \u8fd0\u884c\u65f6\u6027\u80fd\u5dee\\n4. \u53ef\u8bfb\u6027\u5dee\\n\\n> \u52a8\u6001\u7c7b\u578b\u8bed\u8a00\u652f\u6301\u8005\uff1a\\n>\\n> \u6027\u80fd\u53ef\u4ee5\u6539\u5584\uff08V8\uff09\u3001\u8bed\u8a00\u7684\u7075\u6d3b\u6027\u66f4\u52a0\u91cd\u8981\\n>\\n> \u9690\u85cf\u7684\u9519\u8bef\u53ef\u901a\u8fc7\u5355\u5143\u6d4b\u8bd5\u53d1\u73b0\\n>\\n> \u6587\u6863\u53ef\u4ee5\u901a\u8fc7\u5de5\u5177\u751f\u6210\\n\\n![image-20230914110045849](./image-20230914110045849.png)\\n\\n## TS\u57fa\u672c\u4f7f\u7528\\n\\n```zsh\\n## \u5168\u5c40\u5b89\u88c5 typescript\\nnpm install typescript -g \\n\\n\u5373\u53ef\u5728\u5168\u5c40\u4f7f\u7528 tsc \u547d\u4ee4\\n\\n## \u521d\u59cb\u5316 tsconfig.json \u6587\u4ef6\\ntsc --init\\n\\n## \u7f16\u8bd1\u6307\u5b9a\u6587\u4ef6\\ntsc <path/to/your/js/file>\\ne.g. tsc ./src/index.js\\n\\n```\\n\\n### \u6570\u636e\u7c7b\u578b\\n\\n### ES6\\n\\n1. Boolean  \\n2. Number\\n3. String\\n4. Array\\n5. Function\\n6. Object\\n7. Symbol\\n8. undefined\\n9. null\\n\\n### Typescript \u6570\u636e\u7c7b\u578b\\n\\n\u5728 ES6 \u57fa\u7840\u4e0a\u8865\u5145\u4e86\\n\\n1. void\\n2. any\\n3. never\\n4. \u5143\u7ec4 **\u9650\u5b9a\u6570\u7ec4\u4e2a\u6570\u548c\u6570\u7ec4\u7c7b\u578b**\\n5. \u679a\u4e3e\\n6. \u9ad8\u7ea7\u7c7b\u578b\\n\\n### \u7c7b\u578b\u6ce8\u89e3 (\u53d8\u91cf/\u51fd\u6570) : type\\n\\n```ts\\n# \u57fa\u7840\u7c7b\u578b\\nlet bool:boolean = true\\nlet str: string = \'str\'\\nlet num: number = 123\\n\\n# \u6570\u7ec4\\nlet arr: number[] = [1, 2, 3]\\n# \u4f7f\u7528\u8303\u578b\u548c\u8054\u5408\u7c7b\u578b\\nlet arr2: Array<number | string> = [1, 2, 3, \'4\']\\n\\n# \u5143\u7ec4\uff1a\u7279\u6b8a\u6570\u7ec4\\nlet temp:[string, number] = [\'1\', 2] // \u5426\u5219\u62a5\u9519\\ntemp.push(2) // \u8d8a\u754c\uff0c\u53ef\u63d2\u5165\uff0c\u4f46\u662f\u8bbf\u95ee\u4e0d\u4e86\u8be5\u5143\u7d20\\n\\n# \u51fd\u6570\\nlet add = (x: number, y: number) => x + y\\nlet compute = (x:number, y:number) => number\\nlet compute = (a, b)=> a + b\\n\\n# \u5bf9\u8c61\\nlet obj: {x: number, y: number} = {x:1, y:2}\\n\\n\\n# symbol \u6ca1\u6709\u76f8\u540c\u5143\u7d20\\nlet s1: symbol = Symbol()\\nlet s2 = Symbol()\\nconsole.log(s1 === s2 || s1 == s2) // false\\n\\n# \u679a\u4e3e\\n# \u6570\u5b57\u679a\u4e3e\\nenum Roles = {\\n  Reporter = 1, // \u9ed8\u8ba4\u662f0\uff0c\u4f46\u662f\u53ef\u6307\u5b9a\u6570\u5b57\uff0c\u540e\u9762\u7684\u5143\u7d20\u81ea\u52a8\u9012\u589e\\n  Developer,\\n  Maintainer,\\n  Owner,\\n  Guest\\n}\\nRoles.Reporter // 1\\n## \u5b57\u7b26\u4e32\u679a\u4e3e\\nenum Answer = {\\n  N: \'failed\',\\n  Y: \'succeed\'\\n}\\n## \u679a\u4e3e\u6210\u5458\\nenum Char {\\n  a,\\n  b = Char.a,\\n  c = 1 + 2;\\n  d = Math.random(),\\n  e = \'123\'.length\\n}\\n\\n# \u5e38\u91cf\u679a\u4e3e: \u7f16\u8bd1\u9636\u6bb5\u4f1a\u88ab\u79fb\u9664\uff0c\u51cf\u5c11\u65e0\u7528\u4ee3\u7801\\nconst enum Month {\\n  Jan, Feb, \\n}\\nlet month = [Month.Jan, Month.Feb] // \u7f16\u8bd1\u65f6\u5c06\u5e38\u91cf\u679a\u4e3e\u66ff\u6362\u6210\u5bf9\u5e94\u7684\u5e38\u91cf\\n```"},{"id":"ajax-dynamic","metadata":{"permalink":"/frontend/ajax-dynamic","source":"@site/frontend/2020-03-31-AJAX-\u52a8\u6001\u52a0\u8f7d.md","title":"AJAX \u52a8\u6001\u52a0\u8f7d","description":"\u524d\u60c5","date":"2020-03-31T00:00:00.000Z","tags":[{"inline":true,"label":"AJAX","permalink":"/frontend/tags/ajax"},{"inline":true,"label":"JS","permalink":"/frontend/tags/js"}],"readingTime":4.1,"hasTruncateMarker":false,"authors":[{"name":"Yana Ching","title":"Front End Engineer","url":"https://yamadev.github.io/","imageURL":"https://github.com/yanadev.png","key":"yana","page":null}],"frontMatter":{"slug":"ajax-dynamic","title":"AJAX \u52a8\u6001\u52a0\u8f7d","authors":"yana","tags":["AJAX","JS"]},"unlisted":false,"prevItem":{"title":"TypeScript","permalink":"/frontend/typescript"},"nextItem":{"title":"JS \u539f\u751f\u521b\u5efa\u5bf9\u8c61","permalink":"/frontend/JS-origin"}},"content":"## \u524d\u60c5\\n\\nWeb \u7a0b\u5e8f\u6700\u521d\u7684\u76ee\u7684\u662f\uff1a\u5171\u4eab\u6570\u636e\uff08\u4fe1\u606f\uff09\\n\\n\u4ee5\u524d\u901a\u8fc7\u4ee5\u4e0b\u51e0\u79cd\u65b9\u5f0f\u5bf9\u670d\u52a1\u7aef\u53d1\u8d77\u8bf7\u6c42\uff0c\u83b7\u5f97\u670d\u52a1\u7aef\u7684\u6570\u636e\uff1a\\n\\n- \u5730\u5740\u680f\u8f93\u5165\u5730\u5740\uff0c\u56de\u8f66\uff0c\u5237\u65b0\\n- \u7279\u5b9a\u5143\u7d20\u7684 href \u6216 src \u5c5e\u6027\\n- \u8868\u5355\u63d0\u4ea4\\n\\n:::info \u901a\u8fc7\u4ee5\u4e0a\u83b7\u53d6\u6570\u636e\u5fc5\u987b\u5237\u65b0\u7f51\u9875\uff0c\u5f00\u9500\u5927 :::\\n\\n## AJAX \uff08 Asynchronous JavaScript and XML \uff09\\n\\n\u901a\u8fc7 JavaScript \u53d1\u9001\u8bf7\u6c42\u3001\u63a5\u6536\u54cd\u5e94\uff0c\u4e0d\u5fc5\u5237\u65b0\u9875\u9762\u83b7\u53d6\u6700\u65b0\u6570\u636e\\n\\n- AJAX \u5c31\u662f\u6d4f\u89c8\u5668\u63d0\u4f9b\u7684\u4e00\u5957 API \uff0c\u53ef\u4ee5\u901a\u8fc7 JS \u8c03\u7528\uff0c\u4ece\u800c\u5b9e\u73b0\u63a7\u5236\u8bf7\u6c42\u4e0e\u54cd\u5e94\\n- XML \u662f\u63cf\u8ff0\u6570\u636e\u7684\u4e00\u79cd\u624b\u6bb5\uff0c\u73b0\u4eca\u5e38\u7528 JSON \u6765\u63cf\u8ff0\uff0c\u56e0\u4e3a XML \u76f8\u6bd4 JSON \u5197\u4f59\u592a\u591a\u4e86\\n\\n## AJAX \u57fa\u672c\u4f7f\u7528\\n\\n1. \u521b\u5efa XMLHttpRequest \u7c7b\u578b\u7684\u5bf9\u8c61\\n2. \u8bbe\u7f6e\u8bf7\u6c42\u884c\uff0c\u4e0e\u670d\u52a1\u7aef\u7279\u5b9a\u7aef\u53e3\u521b\u5efa`\u8fde\u63a5` `open\u51fd\u6570`\\n3. \u8bbe\u7f6e\u8bf7\u6c42\u5934 setRequestHeader( )\\n   - \u4f7f\u7528\u4ec0\u4e48\u683c\u5f0f\u7684\u8bf7\u6c42\u4f53\u5c31\u8981\u8bbe\u7f6e\u76f8\u5e94\u7684 Content-Type \u544a\u77e5\u670d\u52a1\u5668\u7aef\\n4. \u8bbe\u7f6e\u8bf7\u6c42\u4f53 send( )\\n\\n```javascript\\nvar xhr = new XMLHttpRequest()\\nconsole.log(xhr.readyState)\\n// => 0 \u521d\u59cb\u5316 \u8bf7\u6c42\u4ee3\u7406\u5bf9\u8c61\\n\\nxhr.open(method, url, boolean)\\nconsole.log(xhr.readyState)\\n// => 1 open \u5df2\u7ecf\u8c03\u7528\uff0c\u5efa\u7acb\u4e00\u4e2a\u4e0e\u670d\u52a1\u7aef\u7279\u5b9a\u7aef\u53e3\u7684\u8fde\u63a5\uff08\u5df2\u7ecf\u5efa\u7acb\uff09\\nxhr.send()\\nxhr.addEventListener(\'readystatechange\', function () {\\n  switch (this.readyState) {\\n    case 2:\\n      console.log(this.readyState)\\n      // => 2 \u5df2\u7ecf\u63a5\u6536\u5230\u54cd\u5e94\u62a5\u6587\u7684\u54cd\u5e94\u5934\\n      break\\n    case 3:\\n      console.log(this.readyState)\\n      // => 3 \u6b63\u5728\u4e0b\u8f7d\u54cd\u5e94\u62a5\u6587\u7684\u54cd\u5e94\u4f53\\n      // \u53ef\u80fd\u4e3a\u7a7a \u4e5f\u53ef\u80fd\u4e0d\u5b8c\u6574 \u5728\u6b64\u5904\u5904\u7406\u54cd\u5e94\u4f53\u4e0d\u4fdd\u9669 \uff08\u4e0d\u53ef\u9760\uff09\\n      break\\n    case 4:\\n      console.log(this.readyState)\\n      // => 4 \u4e00\u5207OK\\n      // \u6574\u4e2a\u62a5\u6587\u5df2\u7ecf\u4e0b\u8f7d\u4e0b\u6765\u4e86\\n      break\\n  }\\n})\\n```\\n\\n## readyState \u6709\u4e94\u79cd\u72b6\u6001\uff0c\u56db\u4e2a\u9636\u6bb5\uff080~1\u3001...\uff09\\n\\n- 0 => \u521d\u59cb\u5316\uff0c\u8bf7\u6c42\u4ee3\u7406\u5bf9\u8c61 new XMLHttpRequest()\\n- 1 => \u5efa\u7acb\u8fde\u63a5\uff08\u5df2\u7ecf\u5efa\u7acb\uff09 open\\n- 2 => \u5df2\u7ecf\u63a5\u6536\u5230\u54cd\u5e94\u62a5\u6587\u7684\u54cd\u5e94\u5934 send \u4e4b\u540e\\n- 3 => \u6b63\u5728\u4e0b\u8f7d\u54cd\u5e94\u62a5\u6587\u7684\u54cd\u5e94\u4f53\\n- 4 => \u6574\u4e2a\u62a5\u6587\u5df2\u7ecf\u4e0b\u8f7d\u4e0b\u6765\u4e86\\n\\n:::tip \u5e94\u5f53\u8bbe\u7f6e\u8bf7\u6c42\u4f53\u76f8\u5e94\u7684 `Content-Type` \u544a\u77e5\u670d\u52a1\u5668 :::\\n\\n- onreadystatechange \u51fd\u6570\u53ea\u5728\u72b6\u6001\u6539\u53d8\u7684\u65f6\u5019\u624d\u54cd\u5e94\uff0c\u56e0\u6b64\uff0c\u5982\u679c `xhr.send(method, url, async)` \u4e2d\u7b2c\u4e09\u4e2a\u53c2\u6570 `async` \u5f02\u6b65\u4e3a\\n  `false` \u65f6\uff0c\u53ef\u80fd\u4f1a\u51fa\u73b0\u6765\u4e0d\u53ca\u7684\u73b0\u8c61\\n\\n```javascript\\n/**\\n * \u540c\u6b65\u4e0e\u5f02\u6b65\u6a21\u5f0f\u7684\u533a\u522b\u5728\u4e8e\\n * \u540c\u6b65\u6a21\u5f0f\u4e0b send \u65b9\u6cd5\u4f1a\u51fa\u73b0\u7b49\u5f85\u7684\u60c5\u51b5\\n */\\nconsole.time(\'async\')\\nvar xhrAsync = new XMLHttpRequest() // \u521b\u5efa xhr \u5bf9\u8c61\\nxhrAsync.open(\'GET\', \'./time.php\', \'true\') // \u4e0e\u670d\u52a1\u7aef\u521b\u5efa\u8fde\u63a5\\nxhrAsync.send() // \u8bbe\u7f6e\u8bf7\u6c42\u4f53\u683c\u5f0f\\nconsole.timeEnd(\'async\')\\n// async: 0.645751953125ms\\n\\nconsole.time(\'sync\')\\nvar xhrSync = new XMLHttpRequest()\\nxhrSync.open(\'GET\', \'./time.php\', \'false\')\\nxhrSync.send()\\nconsole.timeEnd(\'sync\')\\n// sync: 0.340087890625ms\\n```\\n\\n## \u7ebf\u7a0b\u4e0e\u8fdb\u7a0b\\n\\n- \u8fdb\u7a0b\uff1a\u8fdb\u884c\u4e2d\u7684\u7a0b\u5e8f\\n- \u7ebf\u7a0b\uff1aCPU \u7684\u6700\u5c0f\u6267\u884c\u5355\u5143\\n\\n## \u603b\u7ed3\\n\\n- `AJAX`\u662f\u6d4f\u89c8\u5668\u63d0\u4f9b\u7684`API`\\n\\n- `XMLHttpRequest` \u7c7b\u578b\\n\\n- `onreadystatechange` \u4e8b\u4ef6 \uff1a\u53ea\u5728\u72b6\u6001\u6539\u53d8\u7684\u65f6\u5019\u54cd\u5e94\\n\\n- `readyState`\uff1a\\n\\n  - 0\uff1a\u8bf7\u6c42\u672a\u521d\u59cb\u5316\\n  - 1\uff1a\u670d\u52a1\u5668\u8fde\u63a5\u5df2\u5efa\u7acb\\n  - 2\uff1a\u8bf7\u6c42\u5df2\u63a5\u6536\uff08\u54cd\u5e94\u5934\uff09\\n  - 3\uff1a\u8bf7\u6c42\u5904\u7406\u4e2d\uff08\u6709\u53ef\u80fd\u62ff\u5230\u4e5f\u6709\u53ef\u80fd\u62ff\u4e0d\u5230\uff09\\n  - 4\uff1a\u8bf7\u6c42\u5df2\u5b8c\u6210\uff0c\u4e14\u54cd\u5e94\u5df2\u5c31\u7eea\\n\\n| Value | State              | Description                                                     |\\n| ----- | ------------------ | --------------------------------------------------------------- |\\n| `0`   | `UNSENT`           | Client has been created. `open()` not called yet.               |\\n| `1`   | `OPENED`           | `open()` has been called.                                       |\\n| `2`   | `HEADERS_RECEIVED` | `send()` has been called, and headers and status are available. |\\n| `3`   | `LOADING`          | Downloading; `responseText` holds partial data.                 |\\n| `4`   | `DONE`             | The operation is complete.                                      |\\n\\n2\uff1aheaderreceive \u63a5\u6536\u5230\u54cd\u5e94\u5934"},{"id":"JS-origin","metadata":{"permalink":"/frontend/JS-origin","source":"@site/frontend/2020-03-31-JS\u539f\u751f\u521b\u5efa\u5bf9\u8c61.md","title":"JS \u539f\u751f\u521b\u5efa\u5bf9\u8c61","description":"\u4e00\u4e9b\u6982\u5ff5","date":"2020-03-31T00:00:00.000Z","tags":[{"inline":true,"label":"JS","permalink":"/frontend/tags/js"},{"inline":true,"label":"\u539f\u751f","permalink":"/frontend/tags/\u539f\u751f"}],"readingTime":0.735,"hasTruncateMarker":false,"authors":[{"name":"Yana Ching","title":"Front End Engineer","url":"https://yamadev.github.io/","imageURL":"https://github.com/yanadev.png","key":"yana","page":null}],"frontMatter":{"slug":"JS-origin","title":"JS \u539f\u751f\u521b\u5efa\u5bf9\u8c61","authors":"yana","tags":["JS","\u539f\u751f"]},"unlisted":false,"prevItem":{"title":"AJAX \u52a8\u6001\u52a0\u8f7d","permalink":"/frontend/ajax-dynamic"},"nextItem":{"title":"\u539f\u578b\u4e0e\u7ee7\u627f","permalink":"/frontend/2020/03/31/\u539f\u578b\u4e0e\u7ee7\u627f"}},"content":"## \u4e00\u4e9b\u6982\u5ff5\\n\\n- \u5c01\u88c5\uff1a\u628a\u5c5e\u6027\u548c\u65b9\u6cd5\u5c01\u88c5\u5728\u5bf9\u8c61\u4e2d\\n- \u5bf9\u8c61\uff1a\u5177\u4f53\u503c\u67d0\u4e2a\u4e8b\u7269\uff0c\u6709\u7279\u5f81\uff08\u5c5e\u6027\uff09\u548c\u884c\u4e3a\uff08\u65b9\u6cd5\uff09\\n\\n## \u521b\u5efa\u5bf9\u8c61\u7684\u4e09\u79cd\u65b9\u5f0f\\n\\n### \u7cfb\u7edf\u6784\u9020\u51fd\u6570\\n\\n```javascript\\nvar obj=new Object();\\n```\\n\\n### \u5b57\u9762\u503c\\n\\n```javascript\\nvar obj={};\\n```\\n\\n### \u81ea\u5b9a\u4e49\u6784\u9020\u51fd\u6570\uff08\u4f18\u5316\u540e\u7684\u5de5\u5382\u6a21\u5f0f\uff09\\n\\n```javascript\\n    //\u81ea\u5b9a\u4e49\u6784\u9020\u51fd\u6570\\n    function Person(name,age,gender){\\n        this.name=name;\\n        this.age=age;\\n        this.gender=gender;\\n        this.work=function(){\\n            console.log(this.name+\\"is working\\");\\n        }\\n    }\\n    var per3=new Person(\\"wang\\",50,\\"male\\");\\n    per3.work();\\n    console.log(per3.work);\\n    console.log(per3 instanceof Person);//\u53ef\u4ee5\u5224\u65ad\u7c7b\u578b\\n```\\n\\n### \u5de5\u5382\u6a21\u5f0f\uff08\u63a8\u8bba\uff09\\n\\n```javascript\\n      //\u5de5\u5382\u6a21\u5f0f\\n      function createObject(name,age,gender){\\n          var obj=new Object();\\n          obj.name=name;\\n          obj.age=age;\\n          obj.gender=gender;\\n          obj.sleep=function(){\\n            console.log(this.name+\\" is sleeping\\");\\n          };\\n          return obj;\\n      }\\n      var per4=createObject(\\"July\\",18,\\"female\\");\\n      per4.sleep();\\n```"},{"id":"/2020/03/31/\u539f\u578b\u4e0e\u7ee7\u627f","metadata":{"permalink":"/frontend/2020/03/31/\u539f\u578b\u4e0e\u7ee7\u627f","source":"@site/frontend/2020-03-31-\u539f\u578b\u4e0e\u7ee7\u627f/index.md","title":"\u539f\u578b\u4e0e\u7ee7\u627f","description":"\u539f\u578b","date":"2020-03-31T00:00:00.000Z","tags":[{"inline":true,"label":"JS\u57fa\u7840","permalink":"/frontend/tags/js\u57fa\u7840"},{"inline":true,"label":"\u539f\u578b","permalink":"/frontend/tags/\u539f\u578b"},{"inline":true,"label":"\u7ee7\u627f","permalink":"/frontend/tags/\u7ee7\u627f"}],"readingTime":3.515,"hasTruncateMarker":false,"authors":[{"name":"Yana Ching","title":"Front End Engineer","url":"https://yamadev.github.io/","imageURL":"https://github.com/yanadev.png","key":"yana","page":null}],"frontMatter":{"title":"\u539f\u578b\u4e0e\u7ee7\u627f","authors":"yana","tags":["JS\u57fa\u7840","\u539f\u578b","\u7ee7\u627f"]},"unlisted":false,"prevItem":{"title":"JS \u539f\u751f\u521b\u5efa\u5bf9\u8c61","permalink":"/frontend/JS-origin"}},"content":"## \u539f\u578b\\n\\n- \u6784\u9020\u51fd\u6570\u4e2d\u4e3aprototype\uff0c\u7a0b\u5e8f\u5458\u4f7f\u7528\\n- \u5b9e\u4f8b\u5bf9\u8c61\u4e2d\u4e3a__proto__\uff0c\u6d4f\u89c8\u5668\u4f7f\u7528\uff0c\u4e0d\u662f\u5f88\u6807\u51c6\\n- \u5b9e\u4f8b\u5bf9\u8c61\u4e2d\u7684__proto__\u6307\u5411\u8be5\u5b9e\u4f8b\u5bf9\u8c61\u7684\u6784\u9020\u51fd\u6570\u4e2d\u7684prototype\\n- \u6784\u9020\u51fd\u6570\u4e2d\u7684prototype\u5c5e\u6027\u548c\u65b9\u6cd5\uff0c\u53ef\u901a\u8fc7\u5b9e\u4f8b\u5bf9\u8c61\u8c03\u7528\\n- \u5f53\u7cfb\u7edf\u5185\u7f6e\u5bf9\u8c61\u7684\u5c5e\u6027\u6216\u8005\u65b9\u6cd5\u65e0\u6cd5\u6ee1\u8db3\u9700\u6c42\u7684\u65f6\u5019\uff0c\u53ef\u4ee5\u901a\u8fc7\u539f\u578b\u4e3a\u5185\u7f6e\u5bf9\u8c61\u6dfb\u52a0\u5c5e\u6027\u6216\u8005\u65b9\u6cd5\\n\\n```javascript\\nString.prototype.ffff = function(){};\\n```\\n\\n## \u7b80\u5355\u7684\u539f\u578b\u5199\u6cd5\\n\\n```javascript\\nPer.prototype={\\n//\u7f3a\u5c11\u6784\u9020\u5668\uff0c\u9700\u8981\u624b\u52a8\u6307\u5411\u6784\u9020\u51fd\u6570\\n constructor:Person\\n}\\n```\\n\\n## \u7ee7\u627f\\n\\n:::tip \u901a\u8fc7\u539f\u578b\u5b9e\u73b0\uff0c\u6539\u53d8\u539f\u578b\u7684\u6307\u5411\\n**\u501f\u7528\u6784\u9020\u51fd\u6570\u7ee7\u627f**\u7684\u65f6\u5019\uff0c\u4e0d\u80fd\u7ee7\u627f\u65b9\u6cd5\\n:::\\n\\n```javascript\\n//\u81ea\u8c03\u7528\u51fd\u6570\\n    (function () {\\n        function Person(name, age, sex, weight){\\n            this.name = name;\\n            this.age = age;\\n            this.sex = sex;\\n            this.weight = weight;\\n        }\\n        Person.prototype.hello = function(){\\n            console.log(\\"Hello!My name is \\"+this.name+\\" This is my message: age:\\"+this.age+\\" sex:\\"+this.sex+\\" weight:\\"+this.weight);\\n        }\\n        window.Person = Person;\\n    }());\\n    //test\\n    var per1 = new Person(\\"Ming\\", 15, \\"female\\", \\"45kg\\");\\n    per1.hello();\\n\\n    //\u81ea\u8c03\u7528\u51fd\u6570\\n    ((function(){\\n        \\n        //----START--------\\n        function Student(score, name, age, sex, weight){\\n            Person.call(this, name, age, sex, weight);//=======\u501f\u7528\u6784\u9020\u51fd\u6570==========\\n            this.score = score;\\n        }\\n        //--------END-------------\\n        \\n        \\n        Student.prototype.myScore = function(){\\n            console.log(this.name+\\"======\\"+this.age+\\"=============\\"+this.sex+\\"===========\\"+this.weight+\\"============\\"+this.score);\\n        }\\n        window.Student = Student;\\n        // Student.prototype.hello = function(){\\n        //     console.log(\\"Student\'s hello\\");\\n        // }\\n    })());\\n    //test\\n    var stu1 = new Student(94,\\"Li\\",45,\\"male\\",\\"95kg\\");\\n    console.log(stu1.myScore);//\u8f93\u51fa\u4ee3\u7801\u5185\u5bb9\\n    stu1.myScore();\\n    stu1.hello();//=========\u62a5\u9519\uff08\u8be5\u65b9\u6cd5\u65e0\u6cd5\u5b9e\u73b0\u65b9\u6cd5\u7684\u5171\u4eab\uff09\\n```\\n\\n:::tip \u8fd0\u884c\u7ed3\u679c\\n:::\\n\\n![1571208798824](./1571208798824-1585640865609.png)\\n\\n## \u7ec4\u5408\u7ee7\u627f\\n\\n> \u501f\u7528\u6784\u9020\u51fd\u6570\u7ee7\u627f\u5c5e\u6027\uff0c\u540c\u65f6\u6539\u53d8\u539f\u578b\u7684\u6307\u5411\uff0c\u53ef\u4ee5\u89e3\u51b3\u5c5e\u6027\u548c\u65b9\u6cd5\u7684\u7ee7\u627f\u95ee\u9898\\n\\n```javascript\\n//\u81ea\u8c03\u7528\u51fd\u6570\\n    (function () {\\n        function Person(name,age,sex,weight){\\n            this.name=name;\\n            this.age=age;\\n            this.sex=sex;\\n            this.weight=weight;\\n        }\\n        Person.prototype.hello=function(){\\n            console.log(\\"Hello!My name is \\"+this.name+\\" This is my message: age:\\"+this.age+\\" sex:\\"+this.sex+\\" weight:\\"+this.weight);\\n        }\\n        window.Person=Person;\\n    }());\\n    //test\\n    var per1=new Person(\\"Ming\\",15,\\"female\\",\\"45kg\\");\\n    per1.hello();\\n\\n    //\u81ea\u8c03\u7528\u51fd\u6570\\n    ((function(){\\n        function Student(score,name,age,sex,weight){\\n            Person.call(this,name,age,sex,weight);//=================\u501f\u7528\u6784\u9020\u51fd\u6570\\n            this.score=score;\\n        }\\n        //-------------------START---------------------\\n        Student.prototype=new Person();//\u4e0d\u4f20\u503c\uff0c\u6539\u53d8\u539f\u578b\u7684\u6307\u5411\\n        //-------------------end---------------------\\n        Student.prototype.myScore=function(){\\n            console.log(this.name+\\"======\\"+this.age+\\"=============\\"+this.sex+\\"===========\\"+this.weight+\\"============\\"+this.score);\\n        }\\n        window.Student=Student;\\n    })());\\n    //test\\n    var stu1=new Student(94,\\"Li\\",45,\\"male\\",\\"95kg\\");\\n    console.log(stu1.myScore);//\u8f93\u51fa\u4ee3\u7801\u5185\u5bb9\\n    stu1.myScore();\\n    // console.log(stu1);/////////////////==================\u4e0d\u6539\u53d8\u6307\u5411\u7684\u65f6\u5019__proto__\u6307\u5411Student\u6784\u9020\u51fd\u6570\u539f\u578b\\n    // stu1.hello();//=========\u62a5\u9519\uff08\u8be5\u65b9\u6cd5\u65e0\u6cd5\u5b9e\u73b0\u65b9\u6cd5\u7684\u5171\u4eab\uff09\\n    console.log(stu1);/////////////////==================\u6539\u53d8\u6307\u5411\u7684\u65f6\u5019__proto__\u6307\u5411Person\u6784\u9020\u51fd\u6570\u539f\u578b\\n    stu1.hello();//\u5b9e\u73b0\u65b9\u6cd5\u5171\u4eab\\n```\\n\\n:::tip \u8fd0\u884c\u7ed3\u679c\\n:::\\n\\n![1571210145954](./1571210145954-1585640865609.png)\\n\\n## \u62f7\u8d1d\u7ee7\u627f(\u76f4\u63a5\u4f20\u5740\uff0c\u975e\u62f7\u8d1d)\\n\\n:::tip \u5373\u628a\u5bf9\u8c61\u4e2d\u539f\u578b\u7684\u6240\u6709\u5c5e\u6027\u548c\u65b9\u6cd5\u4f7f\u7528\u904d\u5386\u7684\u65b9\u5f0f\u590d\u5236\u4e00\u4efd\u7ed9\u53e6\u4e00\u4e2a\u5bf9\u8c61\\n:::\\n\\n### \u65b9\u5f0f\u4e00\\n\\n```javascript\\nvar obj1={\\n      name:\\"MIMI\\",\\n      age:20,\\n      sleep:function(){\\n          console.log(\\"sleeping\\");\\n      }\\n    };\\n    var obj2=obj1;//\u6808\u4e2d=====\u4f20\u5740\\n    console.log(obj2.name,obj2.age);\\n    obj2.sleep();\\n\\n```\\n\\n### \u65b9\u5f0f\u4e8c\\n\\n```javascript\\nvar obj1={\\n      name:\\"MIMI\\",\\n      age:20,\\n      sleep:function(){\\n          console.log(\\"sleeping\\");\\n      }\\n    };\\n    var obj2={};//\u6808\u4e2d=====\u4f20\u5740\\n    for(var key in obj1){\\n        obj2[key]=obj1[key];//JS\u662f\u52a8\u6001\u7c7b\u578b\u7684\u8bed\u8a00\uff0c\u4e66\u5199\u952e\u503c\u5bf9\u76f8\u5f53\u4e8e\u4e0e\\".\\"\u51fa\u4e86\u5c5e\u6027\\n    }\\n    console.log(obj2);\\n\\n```\\n\\n## \u6d45\u62f7\u8d1d\\n\\n:::tip \u5728\u5806\u4e2d\u5b9e\u73b0\u539f\u578b\u5c5e\u6027\u548c\u65b9\u6cd5\u7684\u62f7\u8d1d\uff0c\u539f\u5bf9\u8c61\u4e2d\u7684\u4ecd\u7136\u5b58\u5728\u90e8\u5206\u4e0d\u53ef\u62f7\u8d1d\u7684\u65b9\u6cd5\u548c\u5c5e\u6027\\n:::\\n\\n```javascript\\n    ((function(){\\n        function Person(){\\n\\n        }\\n        Person.prototype.age=10;\\n        Person.prototype.sex=\\"male\\";\\n        Person.prototype.weight=\\"50kg\\";\\n        Person.prototype.play=function(){\\n            console.log(\\"Have a good time!\\");\\n        }\\n        window.Person=Person;\\n    })());\\n    var obj2={};\\n    for(var key in Person.prototype){\\n        obj2[key]=Person.prototype[key];\\n    }\\n    console.dir(obj2);\\n    obj2.play();\\n\\n```\\n\\n:::tip \u8fd0\u884c\u7ed3\u679c\\n:::\\n\\n![1571233114884](./1571233114884-1585640865609.png)"}]}}')}}]);